-- Changeset v4-300
PRINT 'Starting changeset 300';
GO

IF OBJECT_ID('dbo.staging_table_300', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_300 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

GO

IF OBJECT_ID('dbo.proc_transform_300', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_300;
GO
CREATE PROCEDURE dbo.proc_transform_300
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_300
    SET payload = LEFT(payload, 1000) + N'|V4-300|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_300;
END
GO
IF OBJECT_ID('dbo.audit_v4_300', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_300 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_300;
GO

CREATE INDEX IDX_staging_300_payload ON dbo.staging_table_300 (id);
GO
EXEC sp_updatestats;
GO

PRINT 'Completed changeset 300';
GO
